import React from "react";

var inputStyle = {
  "border-radius": "15px",
  width: "300px",
  marginTop: "25px",
  height: "30px",
  "text-align": "center",
  marginLeft: "15%",
  "background-color": "lightblue"
};
var containerStyle = {
  "border-radius": "20px",
  width: "40%",
  left: "25%",
  top: "10%",
  position: "absolute",
  "text-align": "center",
  padding: "20px",
  "background-color": "tomato"
};
var headStyle = {
  "font-size": "25px",
  border: "3px solid black",
  height: "30px",
  "text-align": "center",
  "background-color": "aqua"
};
class Register extends React.Component {
  render() {
    return (
      <div style={headStyle}>
        <div>Pagina de inregistrare</div>
        <div style={containerStyle}>
          <input style={inputStyle} placeholder="Nume" />
          <br />
          <input style={inputStyle} placeholder="Prenume" />
          <br />
          <input style={inputStyle} placeholder="Parola" />
          <br />
          <input style={inputStyle} placeholder="Confirmare parola" />
          <br />
          <input style={inputStyle} placeholder="Numar de telefon" />
          <br />
          <input style={inputStyle} placeholder="link pentru poza" />
          <br />
          <input style={inputStyle} placeholder="email" />
          <br />
        </div>
        <div />
      </div>
    );
  }
}

export default Register;
